import Layout from '../components/MyLayout';

export default function Post(props) {
    return (
        <Layout>
            <p>This is the blog post content for {}</p>
            <p>{props.id}</p>
        </Layout>
    );
}

Post.getInitialProps = async ({ query }) => {
    return { id: query.id };
};
